import React from 'react';
import '../../App.css';
import ButtonMailto from '../../components/Email';


export default function ContactUs() {
  return (<>
  <h1 className='contact-us-2'>CONTACTO EDS
  <ButtonMailto className='contact-us' label="Enviame un email" mailto="mailto:electronicdynamicsystems@gmail.com"  />
  </h1>

  </>
  );
}
